import React, {useState} from 'react';
import Child2 from './Child2';

const Parent2 = () => {

    const [name, setName] = useState('')
    const handleInputParentChange = (name) => {
      setName(name)
    }

    return (
        <div>
            <h1>Parent component</h1>
            <p placeholder={'...'}>Name is: {name} </p>
            <Child2 onChange={handleInputParentChange}/>
        </div>
    );
};

export default Parent2;
